I see:

WARNING: Project specifies a minimum meson_version '>=0.57.0' but uses features which were added in newer versions:
 * 0.58.0: {'Positional argument to dependency.get_variable()'}

if doing a standalone build and tests are enabled, this will always fail because it never got a chance to look up the subproject on line 33+ and required is true, so how about like:

if build_tests.enabled()
  gmock_dep = dependency('gmock', disabler: true, required: false)
  gtest_dep = dependency('gtest', main: true, disabler: true, required: false)
  if not gtest_dep.found() or not gmock_dep.found()
  ...
